// navbar:
// adheres to bottom of screen/app
// 3 buttons, profile, search, and logout
// grid layout in css file, 3 columns
import { useContext } from 'react';
import { Link } from 'react-router-dom';
import { UserContext } from './context/userProvider';

export default function NavBar(props){
    const { logout } = useContext(UserContext)

    return(
        <div className='mx-auto grid-cols-4'>
            <Link className='col-span-1' to='/'> profile </Link>
            <Link className='col-span-2' to='/search'> search </Link>
            <Link className='col-span-3' to='/lists'> friends </Link>
            <button className='col-span-4' onClick={logout}> logout </button>
        </div>
    )
}
